import React, { Component } from 'react';
import './general.css';


class General extends Component {
    constructor() {
        super();

        this.state = {
            name: 'John Smith',
            email: 'john.smith@gmail.com',
            phone: '+39 8473847298',
            address: 'London, UK',
            linkedin: 'linkedin.com/in/username'
        }
    }

    render() {
        const { name, email, phone, address, linkedin } = this.state;

        return (
            <div id="general">
                <div className="wrapper">
                    <img src={require("./img/pp.png")} id="pp"></img>
                </div>
                <div className="wrapper">
                    <div className="value" contentEditable="true" id="name">{name}</div>
                </div>
                <div className="wrapper">
                    <div className="label">Email</div>
                    <div className="value" contentEditable="true">{email}</div>
                </div>
                <div className="wrapper">
                    <div className="label">Phone number</div>
                    <div className="value" contentEditable="true">{phone}</div>
                </div>
                <div className="wrapper">
                    <div className="label">Address</div>
                    <div className="value" contentEditable="true">{address}</div>
                </div>
                <div className="wrapper">
                    <div className="label">LinkedIn</div>
                    <div className="value" contentEditable="true">{linkedin}</div>
                </div>
            </div>
        )
    }
}

export default General
